define(
    ['backbone', 'event'],
    function (Backbone, event) {
        var View = Backbone.View.extend({
            template: {},
            initialize: function () {
                this.render();
                this.generateBackground();
                window.addEventListener('load', _.bind(this.resize, this));
            },
            render: function () {
                this.$el.html(this.template());
            },
            show: function () {
                $('#page').html(this.el);
                // Добавляет всем кнопкам вызов события 'navigate'
                // Внутри события передается id кнопки
                this.$el.find('button').click(function (e) {
                    e.preventDefault();
                    event.trigger('navigate', $(this).attr('id'));
                    console.log('navigate');
                });
                this.$el.show();
            },
            hide: function () {
                this.$el.hide();
                // Отключаем прослушку событий
                this.$el.off();
            },
            generateBackground: function () {
                var backgroundImages = {
                        height : 30,
                        width : 50,
                        images : [
                            "data:image/png;base64,",
                            "data:image/png;base64,",
                            "data:image/png;base64,",
                            "data:image/png;base64,"
                        ],
                        figure : [
                            "data:image/png;base64,",
                            "data:image/png;base64,",

                            "data:image/png;base64,",
                            "data:image/png;base64,",

                            "data:image/png;base64,",
                            "data:image/png;base64,",

                            "data:image/png;base64,",
                            "data:image/png;base64,",


                        ]
                    },
                    backgroundCanvas = document.getElementById("pageBackground"),
                    stage = new createjs.Stage(backgroundCanvas),
                    randomTheme = Math.random() * backgroundImages.images.length  ^ 0,
                    graphElement = new createjs.Bitmap(backgroundImages.images[randomTheme]),
                    height = backgroundCanvas.height - 30,
                    width = backgroundCanvas.width ;

                for (var i = 0, counti = width / backgroundImages.width + 1; i < counti; i++) {
                    for (var j = 0, countj = height / backgroundImages.height + 1; j < countj; j++) {
                        var tempBitMap = graphElement.clone();
                        tempBitMap.x = i * 50;
                        tempBitMap.y = j * 30;
                        stage.addChild(tempBitMap);
                    }
                }
                for (var i = 0; i < 10; i++) {
                    graphElement = new createjs.Bitmap(backgroundImages.figure[randomTheme * 2]);
                    graphElement.x = Math.random() * width;
                    graphElement.y = Math.random() * height;
                    stage.addChild(graphElement);
                    graphElement = new createjs.Bitmap(backgroundImages.figure[randomTheme * 2 + 1]);
                    graphElement.x = Math.random() * width;
                    graphElement.y = Math.random() * height;
                    stage.addChild(graphElement);
                }
                stage.update();
            },
            resize: function () {
                console.log("load...");
            }
        });

        return View;
    }
);